import React, { useState } from 'react';


function AddCar({ handelAddCar }) {
    console.log("add",handelAddCar);
    
    const [brand, setBrand] = useState('');
    const [model, setModel] = useState('');
    const [year, setYear] = useState('');
    const [price, setPrice] = useState('');
    const [description, setDescription] = useState('');
    const [image, setImage] = useState('');
    console.log(brand,model,year,price,description,image);
    


    return (
        <div className="add-car-form">
            <form >
                <input type="text" name="brand" placeholder="Brand"  onChange={(e)=>setBrand(e.target.value)} />
                <input type="text" name="model" placeholder="Model" onChange={(e)=>setModel(e.target.value)} required />
                <input type="number" name="year" placeholder="Year"  onChange={(e)=>setYear(e.target.value)} required />
                <input type="number" name="price" placeholder="Price"  onChange={(e)=>setPrice(e.target.value)} required />
                <input type="text" name="description" placeholder="Description" onChange={(e)=>setDescription(e.target.value)} required />
                <input type="text" name="image" placeholder="Image URL"  onChange={(e)=>setImage(e.target.value)} required />
                <button type="submit"  onClick={()=>{handelAddCar(brand,model,year,price,description,image)}}>Add Car</button>
            </form>
        </div>
    );
}

export default AddCar;

